import React, { useState, useEffect, useRef } from 'react';
import './ChiptuningBlock.css';
import {
  powerImg,
  dynamicsImg,
  fuelImg,
  smoothImg,
  errorImg,
  safetyImg,
  stage1,
  stage2,
  stage3
} from 'images/chiptuning';

const features = [
  { title: 'Creștere putere', text: ['Până la +10% la motoare atmosferice', 'Până la +50% la motoare turbo'], img: powerImg },
  { title: 'Dinamica îmbunătățită', text: ['Accelerație mai rapidă și mai lină', 'Schimbări de trepte mai rare'], img: dynamicsImg },
  { title: 'Economie de combustibil', text: ['Reducere consum cu până la 15%', 'Optimizare costuri de exploatare'], img: fuelImg },
  { title: 'Funcționare lină', text: ['Schimbare trepte lină pentru cutii automate', 'Control îmbunătățit al mașinii'], img: smoothImg },
  { title: 'Corectare erori', text: ['Rezolvarea erorilor software din fabrică', 'Optimizarea parametrilor motorului'], img: errorImg },
  { title: 'Siguranță și fiabilitate', text: ['Fără intervenții mecanice majore', 'Păstrarea echilibrului motorului'], img: safetyImg },
];

const stages = [
  { title: 'STAGE 1', desc: 'Optimizare software ECU fără modificări hardware. Echilibru putere/consum pentru utilizare zilnică.', img: stage1 },
  { title: 'STAGE 2', desc: 'Chiptuning pentru admisie/evacuare modificate. Răspuns mai rapid și cuplu mai mare.', img: stage2 },
  { title: 'STAGE 3', desc: 'Setări pentru componente performante. Maximizarea performanței cu hardware extins.', img: stage3 },
];

const accordions = [
  { title: 'Ce este chiptuning-ul?', content: `Chiptuning-ul înseamnă optimizarea softului ECU/TCU ...` },
  { title: 'Chiptuning motoare pe benzină și diesel', content: `La motoarele pe benzină se ajustează ...` },
  { title: 'De ce să alegi chiptuning-ul?', content: `• Creșterea performanțelor fără modificări mecanice ...` },
];

export default function Chiptuning() {
  const [open, setOpen] = useState<number | null>(null);
  const [visibleCards, setVisibleCards] = useState<number[]>([]);
  const cardRefs = useRef<(HTMLDivElement | null)[]>([]);

  const toggleAccordion = (idx: number) => setOpen(open === idx ? null : idx);

  useEffect(() => {
    const observer = new IntersectionObserver(
      entries => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            const idx = Number(entry.target.getAttribute('data-idx'));
            setVisibleCards(prev => (prev.includes(idx) ? prev : [...prev, idx]));
          }
        });
      },
      { threshold: 0.2 }
    );
    cardRefs.current.forEach(card => card && observer.observe(card));
    return () => { cardRefs.current.forEach(card => card && observer.unobserve(card)); };
  }, []);

  return (
    <section id="chiptuning" className="chip">
      <h2 className="chip__title">Ce oferă chiptuning-ul</h2>

      <div className="chip__grid">
        {features.map((f, i) => (
          <article
            key={i}
            ref={el => (cardRefs.current[i] = el)}
            data-idx={i}
            className={`chip__card ${visibleCards.includes(i) ? 'revealed' : ''}`}
            aria-label={f.title}
          >
            <div className="chip__content">
              <h3 className="chip__card-title">{f.title}</h3>
              <ul className="chip__list">
                {f.text.map((line, idx) => <li key={idx}>{line}</li>)}
              </ul>
            </div>
            <div className="chip__media">
              <img src={f.img} alt="" aria-hidden="true" loading="lazy" />
            </div>
          </article>
        ))}
      </div>

      <div className="chip__stages">
        {stages.map((s, i) => (
          <div key={i} className="chip__stage">
            <img src={s.img} alt="" className="chip__stage-img" />
            <span className="chip__stage-title">{s.title}</span>
            <p className="chip__stage-desc">{s.desc}</p>
          </div>
        ))}
      </div>

      <div className="chip__accordions">
        {accordions.map((a, i) => (
          <div key={i} className={`chip__accordion ${open === i ? 'chip__accordion--open' : ''}`}>
            <button className="chip__accordion-header" onClick={() => toggleAccordion(i)}>
              {a.title}
              <span className={`chip__accordion-icon ${open === i ? 'open' : ''}`} />
            </button>
            {open === i && <div className="chip__accordion-content"><p>{a.content}</p></div>}
          </div>
        ))}
      </div>
    </section>
  );
}
